import React from 'react';
import './Home.css';


function Home(){

    const mateo = require('./mateofabian.jpeg');

    return(
        <div className="content">
            <div className="title">
                <h2>Mateo Jara Fabian</h2>
            </div>
            <div className="left-content">
                <image src={mateo} alt="mateo"/>
                <p>Here picture!</p>
            </div>
            <div className="right-content">
                <p>Here description</p>
            </div>
        </div>
    )
}

export default Home;
